last_tc=None

def _find_tri(RA: float, DEC: float) -> tuple:
    """
    Looking for a triangle containing (RA,DEC) point, returns tuple from tri_cache
    """
    global last_tc
    def chk_tc(tc):
        if RA>=tc[0] and RA<=tc[1] and DEC>=tc[2] and DEC<=tc[3]:
            return (RA*tc[4]+DEC*tc[5]+tc[6])>0 and (RA*tc[7]+DEC*tc[8]+tc[9])>0 and (RA*tc[10]+DEC*tc[11]+tc[12])>0
    if last_tc and chk_tc(last_tc):
        return last_tc
    for tc in tri_cache:
       if chk_tc(tc):
           last_tc=tc
           return tc
    return None

def mean(RA: float, DEC: float) -> float:
    """
    Returns mean distance between stars for (RA, DEC)\n
    RA and DEC must be in degrees, result will be returned in arcsec
    """
    if 0 <= RA <= 360 and -90 <= DEC <= 90:
        tri=_find_tri(RA,DEC)
        if tri:
            (_,_, _,_, _,_,_, _,_,_, _,_,_, kx,ky,z0, _,_,_)=tri
            return kx*RA+ky*DEC+z0
    else:
        raise ValueError('RA must be in range [0,360], DEC must be in range [-90,90]')

def median(RA: float, DEC: float) -> float:
    """
    Returns median distance between stars for (RA, DEC)\n
    RA and DEC must be in degrees, result will be returned in arcsec
    """
    if 0 <= RA <= 360 and -90 <= DEC <= 90:
        tri=_find_tri(RA,DEC)
        if tri:
            (_,_, _,_, _,_,_, _,_,_, _,_,_, _,_,_, kx,ky,z0)=tri
            return kx*RA+ky*DEC+z0
    else:
        raise ValueError('RA must be in range [0,360], DEC must be in range [-90,90]')


